import React from 'react';
 
const Navbar = () => {
    return ( 
        <div>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/new-post">New Post</a></li>
                <li><a href="/login">Login</a></li>
            </ul>
        </div>
     );
}
 
export default Navbar;
